import React from "react";
import "./Gallery.css";

const artworks = [
  { id: 1, src: "https://via.placeholder.com/300x300?text=Artwork+1", title: "Artwork 1" },
  { id: 2, src: "https://via.placeholder.com/300x300?text=Artwork+2", title: "Artwork 2" },
  { id: 3, src: "https://via.placeholder.com/300x300?text=Artwork+3", title: "Artwork 3" },
  { id: 4, src: "https://via.placeholder.com/300x300?text=Artwork+4", title: "Artwork 4" },
  { id: 5, src: "https://via.placeholder.com/300x300?text=Artwork+5", title: "Artwork 5" },
  { id: 6, src: "https://via.placeholder.com/300x300?text=Artwork+6", title: "Artwork 6" },
  { id: 7, src: "https://via.placeholder.com/300x300?text=Artwork+7", title: "Artwork 7" },
  { id: 8, src: "https://via.placeholder.com/300x300?text=Artwork+8", title: "Artwork 8" },
  { id: 9, src: "https://via.placeholder.com/300x300?text=Artwork+9", title: "Artwork 9" },
  { id: 10, src: "https://via.placeholder.com/300x300?text=Artwork+10", title: "Artwork 10" },
];

const Gallery = () => {
  return (
    <div className="gallery">
      {artworks.map((art) => (
        <div key={art.id} className="art-item">
          <img src={art.src} alt={art.title} />
          <h3>{art.title}</h3>
        </div>
      ))}
    </div>
  );
};

export default Gallery;
